import React, { useState } from "react";

const Form = () => {
  const [teste, setTeste] = useState({
    name: "",
    age: "",
    contact: "",
    reason: "",
    date: new Date(),
  });
  const onChange = () => {
    setTeste((e) => {});
  };
  return (
    <>
      <div className="form-container">
        <form>
          <div>
            <label htmlFor="name">Nome</label>
            <input type="text" id="name" name="name" value={teste.name} />
          </div>
          <div>
            <label htmlFor="age">Idade</label>
            <input type="text" id="age" name="age" value={teste.age} />
          </div>
          <div>
            <label htmlFor="contact">Contacto</label>
            <input
              type="text"
              id="contact"
              name="contact"
              value={teste.contact}
            />
          </div>
          <div>
            <label htmlFor="sintomas">Sintomas</label>
            <input
              type="checkbox"
              id="sintomas"
              name="sintomas"
              value={teste.reason}
            />
            <label htmlFor="contactoRisco">Contacto Risco</label>
            {/* <input
              type="checkbox"
              id="contactoRisco"
              name="contactoRisco"
              value={teste.name}
            /> */}
          </div>
          <div>
            <label htmlFor="marcacao">Nome</label>
            <input
              type="date"
              id="marcacao"
              name="marcacao"
              value={teste.name}
            />
          </div>
        </form>
      </div>
    </>
  );
};

export default Form;
